import React from "react";
import {
  Container,
  Text,
  PrimaryButton,
  SearchInput
} from "../../styledComponents";
import styled from "styled-components";

const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  justify-content: "space-between";
  padding-right: 110px;
  padding-top: 30px;
  padding-bottom: 30px;
  padding-left: 110px;
  background-color: white;
`;
const Houses = () => {
  return (
    <Container flex={1} color="blue">
      <SearchWrapper>
        <Container flex={1} color="transparent">
          <TextInput
            placeholder="What house are you looking for?"
            customStyles={{ width: "70%" }}
          />
        </Container>

        <PrimaryButton>Search</PrimaryButton>
      </SearchWrapper>
      >
    </Container>
  );
};

export default Houses;
